script: |
  super -f text -I q6503.spq | sort > q6503.out

inputs:
  - name: q6503.spq
    data: |
      SELECT + + col2 + + col2 FROM tab0 (FORMAT parquet) WHERE NOT col2 * + + col0 BETWEEN ( + 73 ) + + col2 + - col0 AND + + 17 * - ( + col0 ) * + + 96;
  - name: tab0

outputs:
  - name: q6503.out
    data: |
      198
      20
      94
